import React from "react";
import "./Login.css";

function Login() {
  return (
    <div className="login">
      <h3>E-mail ID</h3>
      <input
        type="text"
        className="username"
        placeholder="Enter your E-mail ID"
      />
      <h3>Password</h3>
      <input
        type="text"
        className="password"
        placeholder="Enter your password"
      />
      <button className="login">Sign In</button>
    </div>
  );
}

export default Login;
